import React from "react";
import "./style.css";
function Form(props) {
  const input_field = "";
  if (props.turul == "num") {
    input_field = (
      <div>
        <input
          className="orolt"
          type="text"
          placeholder={props.placeholder}
          id={props.id}
          onChange={props.changed}
        />
      </div>
    );
  } else {
  }
  return (
    <div>
      <input
        className="orolt"
        type="text"
        placeholder={props.placeholder}
        id={props.id}
        onChange={props.changed}
      />
    </div>
  );
}
export default Form;
